import React from "react"


export default function Box(props){
    const [on, setOn] = React.useState(props.on)

    const styles = {
        backgroundColor : on ? "black" : "transparent"
    }
    return (
        <div style={styles} className = "box" onClick={()=> props.toggle(props.id)}></div>
    )
}
